import React, { Component } from 'react';


class Registration extends Component {
  render() {
    return (
        <div class="container">
          <form name="myform" class="form-group" />
            <div class="row"/>
              <div class="col-sm-4"/>
              <label for="inputname">First name</label>            

          
            this is registration form

        </div>
        );
    }
  }
  
  export default Registration;
